import React from "react";
import "./Input";
class MyComponent extends React.Component {
  state = {
    value: "",
    showInput: false,
  };
  onChange = (event) => {
    const value = event.target.value;

    this.setState((prevState) => {
      return {
        value,
      };
    });
  };
  render() {
    return (
      <div>
        <div>
          <input type="text" className="input" />
        </div>
        <button onClick></button>
      </div>
    );
  }
}

export default MyComponent;
